DROP TABLE IF EXISTS `t_lx_leave`;
CREATE TABLE `t_lx_leave` (
  `id` varchar(32) NOT NULL,
  `createTime` datetime NOT NULL,
  `creatorCode` varchar(255) NOT NULL,
  `creatorFullName` varchar(255) NOT NULL,
  `creatorUnitCode` varchar(255) NOT NULL,
  `deleteTime` datetime DEFAULT NULL,
  `fileTypeCode` varchar(32) NOT NULL,
  `processId` varchar(32) NOT NULL,
  `end` datetime DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `reason` varchar(255) DEFAULT NULL,
  `start` datetime DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

